description.p:
The method comprises the following steps:
a) generating at least one fast-transient voltage signal and applying the fast-transient voltage signal to the measurement electrodes;
b) measuring a response signal;
c) determining the at least one membrane property by evaluating of the response signal.

Specifically, the method comprises the following steps:
generating the at least one fast-transient voltage Ugen,pulse and applying it to a membrane comprising circuit serially connected with a reference resistor Rref, wherein the membrane element has a resistance Rmem;
recording a voltage Umeas,pulse either at the reference resistor Rref or at the membrane element comprising circuit Rmem;
determining the at least one membrane property by calculating the Rmem from Ugen,pulse, Umeas,pulse and Rref.

Embodiment 1: Method for determining at least one membrane property of an analyte sensor, wherein the analyte sensor comprises at least two measurement electrodes, wherein at least one of the measurement electrodes comprises at least one membrane element having the at least one membrane property, the method comprising the following steps:
a) generating at least one fast-transient voltage signal and applying the fast-transient voltage signal to the measurement electrodes;
b) measuring at least one response signal;
c) determining the at least one membrane property by evaluating of the response signal.

FIGS. 4A and 4B show a further example of an operating principle according to this disclosure. FIG. 4A shows a simplified circuit and FIG. 4B shows a fast-transient voltage profile. Specifically, the method may comprise the following steps:
generating the at least one fast-transient voltage Ugen,pulse and applying it to a membrane comprising circuit serially connected with a reference resistor Rref, wherein the membrane element has a resistance Rmem;
recording a voltage Umeas,pulse either at the reference resistor Rref or at the membrane element comprising circuit Rmem;
determining the at least one membrane property by calculating the Rmem from Ugen,pulse, Umeas,pulse and Rref.
